import React from "react";
import { Box, Grid, ThemeProvider, FilledInput, Select, MenuItem, Dialog,DialogHeader, DialogTitle, DialogContent, DialogActions } from "@material-ui/core";


export default props => {
   
    return(
        <Dialog>
            <DialogTitle> Post Job</DialogTitle>
            <DialogContent> 
                <Grid container>
                    <Grid item xs={6}>
                        <FilledInput placeholders="Job title *" disableUnderlines/>
                    </Grid>
                    </Grid>



            </DialogContent>
        </Dialog>

    )

}
